import React, { useEffect, useState } from "react";

export default function Fetchv(){
    const [aaa, setAAA] = useState('');
    const [UserData, setUserData] = useState([])
        useEffect(() => { 
        function kk () {
        fetch('https://randomuser.me/api/')
        .then((res) => res.json())
        .then((data) => {
            setUserData(data)
        })
    } kk()}, [])
    console.log(UserData)
    return(
    <>
    <div>
        <p>
            {UserData}
        </p>
    </div>
    </>)
}
